import React, { Component } from 'react';
import {Link} from 'react-router-dom'
import _ from "lodash";
import "./HeaderNav.scss";
import Button from '../../Common/Button/Button';

export default class HeaderNav extends Component {

  navs = [
    {
      path: "home",
      value: "Home"
    },
    {
      path: "portfolio",
      value: "Portfolio"
    },
    {
      path: "blog",
      value: "Blog"
    },
    {
      path: "contact",
      value: "Contact",
      style: "border"
    }
  ]

  render() {

    return (
      <React.Fragment>
          <ul className="headerNav ml-auto">
          {this.navs.map(item => 
            <li className="headerNav__item">
              <Button 
                btnStyle={item["style"]}
                to={item.path}
                value={item.value}
              />
            </li>
          )}
          <Button
            btnStyle="border"
            to="home"
            value="Home"
          />
          <Button
            to="contact"
            value="Contact"
          />
          </ul>
      </React.Fragment>
    )
  }
}
